import React from 'react';

const About = () => {

const [ count, setCount ] = useState(0);

homeRoute = (home) => {
  if (home === 'http://localhost:3000/') {
    setCount(count + 1)
  }
}

    return (
        <div className="tc ph4 pa4">
          <h1 id="about" className='f3 f2-m f1-l fw2 mv3 pa4 b red'>HELLO WORLD!</h1>
          <div>
          <p>You clicked {count} times</p>
          </div>
          <div className='pa4'>
           <p class="f5 f4-m f3-l fw2 mt0 lh-copy">This is my personal portfolio, a work in progress.</p>
           <p class="f5 f4-m f3-l fw2 mt0 lh-copy">Passionate about technology, and everything around it.</p>
           <p class="f5 f4-m f3-l fw2 mt0 lh-copy">Skills in HTML, CSS and JavaScript.</p>
           <p class="f5 f4-m f3-l fw2 mt0 lh-copy">Other skills like ReactJS, NodeJS, ExpressJS, SQL and NoSQL.</p>
          </div>
          <div class="bb bw3 pa4 w5 center near-black"> </div>
        </div>
    );
}

export default About;
